import React from "react";
import { NavLink, withRouter } from "react-router-dom";
import { connect } from "react-redux";
import "./css/navbar.css";

const Navbar = props => {
  //home icon and link
  let homeLink =
    props.location.pathname !== "/" ? (
      <NavLink to="/">
        <img
          className="iconStyle"
          src={require("../imgs/homeIcon.png")}
          alt="homeIcon"
        />
      </NavLink>
    ) : null;

  //profile and sign in link
  const imgIconForProfile = (
    <img
      className="iconStyle"
      src={require("../imgs/user.png")}
      alt="profileIcon"
    />
  );
  let isSignedIn = useSelector(state => state.isSignedIn);
  let signInOrProfileRedirect = isSignedIn ? (
    <NavLink to="/profile">{imgIconForProfile}</NavLink>
  ) : (
    <NavLink to="/signIn">{imgIconForProfile}</NavLink>
  );

  return (
    <div className="navbar-parent-main-div">
      <span>{imgIconForProfile}</span> <span>{homeLink}</span>
    </div>
  );
};

//grab cities from redux-store-state and save as params here under this.props.city
const mapStateToProps = state => {
  return {
    isSignedIn: state.isSignedIn
  };
};

export default connect(mapStateToProps)(withRouter(Navbar));
